import {  
  Page404,
  Blog,
  ChangePassword,
  Dashboard,
  EditProfile,
  Editor,
  Home,
  ManageBlogs,
  Notifications,
  Profile,
  Search,
  UserAuthForm,
} from './app'

export const routes = [
  {
    path: '/404',
    element: <Page404 />
  },
  {
    path: '/blog',
    element: <Blog />
  },
  {
    path: '/change-password',
    element: <ChangePassword />
  },
  {
    path: '/dashboard',
    element: <Dashboard />
  },
  {
    path: '/edit-profile',
    element: <EditProfile />
  },
  {
    path: '/editor',
    element: <Edit />
  },
]
